import React, { useState } from 'react';
import styled, { keyframes } from 'styled-components';

const move = keyframes`
  0%, 49.99% {
    opacity: 0;
    z-index: 1;
  }
  50%, 100% {
    opacity: 1;
    z-index: 5;
  }
`;

const Container = styled.div`
  background-color: #fff;
  border-radius: 30px;
  box-shadow: 0 5px 15px rgba(0, 0, 0, 0.35);
  position: relative;
  overflow: hidden;
  width: 768px;
  max-width: 100%;
  min-height: 480px;
  background-color: #c9d6ff;
  background: linear-gradient(to right, #e2e2e2, #c9d6ff);
  display: flex;
  align-items: center;
  justify-content: center;
  flex-direction: column;
  height: 100vh;
`;

const FormContainer = styled.div`
  position: absolute;
  top: 0;
  height: 100%;
  transition: all 0.6s ease-in-out;
`;

const SignUpForm = styled.form`
  background-color: #fff;
  display: flex;
  align-items: center;
  justify-content: center;
  flex-direction: column;
  padding: 0 40px;
  height: 100%;
`;

const SignInForm = styled.form`
  background-color: #fff;
  display: flex;
  align-items: center;
  justify-content: center;
  flex-direction: column;
  padding: 0 40px;
  height: 100%;
`;

const ToggleContainer = styled.div`
  position: absolute;
  top: 0;
  left: 50%;
  width: 50%;
  height: 100%;
  overflow: hidden;
  transition: all 0.6s ease-in-out;
  border-radius: 150px 0 0 100px;
  z-index: 1000;
`;

const Toggle = styled.div`
  background-color: #512da8;
  height: 100%;
  background: linear-gradient(to right, #5c6bc0, #512da8);
  color: #fff;
  position: relative;
  left: -100%;
  height: 100%;
  width: 200%;
  transform: translateX(0);
  transition: all 0.6s ease-in-out;
`;

const TogglePanel = styled.div`
  position: absolute;
  width: 50%;
  height: 100%;
  display: flex;
  align-items: center;
  justify-content: center;
  flex-direction: column;
  padding: 0 30px;
  text-align: center;
  top: 0;
  transform: translateX(0);
  transition: all 0.6s ease-in-out;
`;

const SocialIcons = styled.div`
  margin: 20px 0;
`;

const SocialIcon = styled.a`
  border: 1px solid #ccc;
  border-radius: 20%;
  display: inline-flex;
  justify-content: center;
  align-items: center;
  margin: 0 3px;
  width: 40px;
  height: 40px;
`;

const StyledButton = styled.button`
  background-color: ${props => (props.hidden ? 'transparent' : '#512da8')};
  color: ${props => (props.hidden ? '#fff' : '#fff')};
  font-size: 12px;
  padding: 10px 45px;
  border: ${props => (props.hidden ? '1px solid #fff' : '1px solid transparent')};
  border-radius: 8px;
  font-weight: 600;
  letter-spacing: 0.5px;
  text-transform: uppercase;
  margin-top: 10px;
  cursor: pointer;
`;

const HiddenButton = styled(StyledButton)`
  background-color: transparent;
  border-color: #fff;
`;

const Input = styled.input`
  background-color: #eee;
  border: none;
  margin: 8px 0;
  padding: 10px 15px;
  font-size: 13px;
  border-radius: 8px;
  width: 100%;
  outline: none;
`;

const StyledLink = styled.a`
  color: #333;
  font-size: 13px;
  text-decoration: none;
  margin: 15px 0 10px;
`;

const Text = styled.span`
  font-size: 12px;
`;

const KeyframesMove = styled.div`
  animation: ${move} 0.6s;
`;

const ActiveContainer = styled(Container)`
  &.active .sign-in {
    transform: translateX(100%);
  }

  &.active .sign-up {
    transform: translateX(100%);
    opacity: 1;
    z-index: 5;
    ${KeyframesMove}
  }

  &.active .toggle-container {
    transform: translateX(-100%);
    border-radius: 0 150px 100px 0;
  }

  &.active .toggle {
    transform: translateX(50%);
  }

  &.active .toggle-left {
    transform: translateX(0);
  }

  &.active .toggle-right {
    transform: translateX(200%);
  }
`;

const ActiveToggle = styled(Toggle)`
  &.active {
    transform: translateX(50%);
  }
`;

const ActiveToggleLeft = styled(TogglePanel)`
  &.active {
    transform: translateX(0);
  }
`;

const ActiveToggleRight = styled(TogglePanel)`
  &.active {
    transform: translateX(200%);
  }
`;


const Login = () => {
    const [isSignUp, setIsSignUp] = useState(false);

    const toggleForm = () => {
      setIsSignUp(!isSignUp);
    };

    return (
      <ActiveContainer className={isSignUp ? 'active' : ''}>
        <FormContainer className={`form-container ${isSignUp ? 'sign-up' : 'sign-in'}`}>
          {isSignUp ? (
            <SignUpForm>
              <h1>Create Account</h1>
              {/* ... rest of the sign-up form */}
              <StyledButton>Sign Up</StyledButton>
            </SignUpForm>
          ) : (
            <SignInForm>
              <h1>Sign In</h1>
              {/* ... rest of the sign-in form */}
              <StyledButton>Sign In</StyledButton>
            </SignInForm>
          )}
        </FormContainer>
        <ToggleContainer>
          <Toggle className={isSignUp ? '' : 'active'}>
            <ActiveToggleLeft className={`toggle-panel ${isSignUp ? 'active' : ''}`}>
              <h1>Welcome Back!</h1>
              <p>Enter your personal details to use all site features</p>
              <HiddenButton onClick={toggleForm}>Sign In</HiddenButton>
            </ActiveToggleLeft>
          </Toggle>
        </ToggleContainer>
      </ActiveContainer>
    );
  };

  export default Login;
